import React from "react";
import logoHenry from "../../assets/logo-henry.png";
import styleNav from "./NavBar.module.css";
import { NavLink } from "react-router-dom";

export default function NavBar() {

  const isActiveFn = (isActive) => {
    if(isActive) return ".active"
    return ".disable"
  }

  return (
    <div className={styleNav.container}>
      <ul className={styleNav.menu}>
        <li>
          <NavLink to={'/'}>
            <img src={logoHenry} alt="logo-henry" />
          </NavLink>
        </li>
        <li>
          <h1>Central de Cruceros</h1>
        </li>
        <div className={styleNav.options}>
          <li>
            <NavLink className={isActiveFn} to={'/shipping'} >
              <span >Navieras</span>
            </NavLink>
          </li>
          <li>
            <NavLink className={styleNav.isActiveFn} to={'/discounts'} >
              <span >Promociones</span>
            </NavLink>
          </li>
        </div>
      </ul>
    </div>
  );
}
